B.HT=new A.rb('F\xfcr die Technische Universit\xe4t M\xfcnchen ist Datenschutz ein wichtiges Anliegen. Wir m\xf6chten, dass Sie wissen, wann wir welche Daten speichern und wie wir sie verwenden. Wir verarbeiten personenbezogene Daten, die beim Besuch unserer Webseiten erhoben werden, unter Beachtung der geltenden datenschutzrechtlichen Bestimmungen, insbesondere dem Bayrischen Datenschutz (BayDSG) und dem Telemediengesetz (TMG).\n\nNachfolgend informieren wir \xfcber Art, Umfang und Zweck der Erhebung und Verwendung personenbezogener Daten.\n\nAllgemeine Informationen\nName und Kontaktdaten des Verantwortlichen\nTechnische Universit\xe4t M\xfcnchen\nPostanschrift: Arcisstra\xdfe 21, 80333 M\xfcnchen\nTelefon: +49-(0)89-289-01\nE-Mail: poststelle(at)tum.de\n\nKontaktdaten des/der Datenschutzbeauftragten\nDer/Die Datenschutzbeauftragte der Technischen Universit\xe4t M\xfcnchen\nPostanschrift: Arcisstra\xdfe 21, 80333 M\xfcnchen\nTelefon: 089/289-17052\nE-Mail: beauftragter(at)datenschutz.tum.de\n\nZwecke und Rechtsgrundlagen f\xfcr die Verarbeitung personenbezogener Daten\nPersonenbezogene Daten, die im Zusammenhang mit der Nutzung von PEER erhoben und verarbeitet werden, dienen der korrekten Funktionsweise der Seite. Die Rechtsgrundlage f\xfcr die Datenerhebung und -verarbeitung ist Ihre Einwilligung gem\xe4\xdf Artikel 6 Absatz 1 lit. a) DSGVO. Wir halten uns an die geltenden Datenschutzbestimmungen, insbesondere an die Datenschutzgrundverordnung und das bayerische Datenschutzgesetz. Ihre Einwilligung ist freiwillig und kann jederzeit wiederrufen werden.\n\nFolgende Daten werden erhoben und gespeichert:\n\nJahrgangsstufe\nSchulart\nBundesland\nBei der Nutzung der Bild-Upload-Funktion wird die Handschrift erfasst und in Text umgewandelt. Nach der Umwandlung wird nur der reine Text gespeichert und das hochgeladene Bild gel\xf6scht.\nDie Daten k\xf6nnen nur von berechtigten Personen eingesehen und bearbeitet werden.\n\nEinsatz der OCR API von Mathpix\nDie automatische Handschrifterkennung erfolgt mit dem Drittanbieter "Mathpix, Inc." (https://mathpix.com). Die hochgeladenen Bilder werden mit Mathpix geteilt und von Mathpix in Text umgewandelt. Die Bilder werden von Mathpix nicht gespeichert.\n\nEinsatz der API von OpenAI\nDie Erstellung des Feedbacks erfolgt mit dem Drittanbieter "OpenAI OpCo, LLC" (https://openai.com). Folgende Informationen werden mit OpenAI geteilt:\n\nAufsatztext\nTitel / Thema\nJahrgangsstufe\nAufsatzart\nLaut der "API Data Usage Policies" von OpenAI werden die Daten nicht zum Training oder zur Verbesserung ihrer Modelle verwendet. Die Daten werden f\xfcr maximal 30 Tage zum Zwecke der Missbrauchs\xfcberwachung gespeichert und danach gel\xf6scht.\n\nIhre Rechte\nSoweit wir von Ihnen personenbezogene Daten verarbeiten, stehen Ihnen als Betroffener nachfolgende Rechte zu:\n\nSie haben das Recht auf Auskunft \xfcber die zu Ihrer Person gespeicherten Daten (Art. 15 DSGVO).\nSollten unrichtige personenbezogene Daten verarbeitet werden, steht Ihnen ein Recht auf Berichtigung zu (Art. 16 DSGVO).\nLiegen die gesetzlichen Voraussetzungen vor, so k\xf6nnen Sie die L\xf6schung oder Einschr\xe4nkung der Verarbeitung verlangen (Art. 17 und 18 DSGVO).\nWenn Sie in die Verarbeitung eingewilligt haben oder ein Vertrag zur Datenverarbeitung besteht und die Datenverarbeitung mithilfe automatisierter Verfahren durchgef\xfchrt wird, steht Ihnen gegebenenfalls ein Recht auf Daten\xfcbertragbarkeit zu (Art. 20 DSGVO).\nFalls Sie in die Verarbeitung eingewilligt haben und die Verarbeitung auf dieser Einwilligung beruht, k\xf6nnen Sie die Einwilligung jederzeit f\xfcr die Zukunft widerrufen. Die Rechtm\xe4\xdfigkeit der aufgrund der Einwilligung bis zum Widerruf erfolgten Datenverarbeitung wird durch diesen nicht ber\xfchrt.\nSie haben das Recht, aus Gr\xfcnden, die sich aus Ihrer besonderen Situation ergeben, jederzeit gegen die Verarbeitung Ihrer Daten Widerspruch einzulegen, wenn die Verarbeitung ausschlie\xdflich auf Grundlage des Art. 6 Abs. 1 Buchst. e oder f DSGVO erfolgt (Art. 21 Abs. 1 Satz 1 DSGVO).\n\nBeschwerderecht bei der Aufsichtsbeh\xf6rde\nWeiterhin besteht ein Beschwerderecht beim Bayerischen Landesbeauftragten f\xfcr den Datenschutz. Diesen k\xf6nnen Sie unter folgenden Kontaktdaten erreichen:\nPostanschrift: Postfach 22 12 19, 80502 M\xfcnchen\nAdresse: Wagm\xfcllerstra\xdfe 18, 80538 M\xfcnchen\nTelefon: 089 212672-0\nE-Mail: poststelle(at)datenschutz-bayern.de\nhttps://www.datenschutz-bayern.de/\n\nWeitere Informationen\nF\xfcr n\xe4here Informationen zur Verarbeitung Ihrer Daten und zu Ihren Rechten k\xf6nnen Sie uns unter den oben genannten Kontaktdaten erreichen.\n\nInformationen zum Internetauftritt\nTechnische Umsetzung\nDie Website wird auf einem Server des Leibniz-Rechenzentrum (LRZ) gehostet.\n\nLeibniz-Rechenzentrum (LRZ)\nBoltzmannstra\xdfe 1\n85748 Garching b. M\xfcnchen\n\nDie Installation der Cookies k\xf6nnen Sie durch eine entsprechende Einstellung Ihres Browsers verhindern. Wir weisen jedoch darauf hin, dass Sie in diesem Fall gegebenenfalls nicht s\xe4mtliche Funktionen dieser Website vollumf\xe4nglich nutzen k\xf6nnen.\n\nProtokollierung\nWenn Sie diese oder andere Internetseiten aufrufen, \xfcbermitteln Sie \xfcber Ihren Internetbrowser Daten an unseren Webserver. Die folgenden Daten werden w\xe4hrend einer laufenden Verbindung zur Kommunikation zwischen Ihrem Internetbrowser und unserem Webserver tempor\xe4r in einer Logdatei aufgezeichnet:\n\nIP-Adresse des anfragenden Rechners\nDatum und Uhrzeit des Zugriffs\nName, URL und \xfcbertragene Datenmenge der abgerufenen Datei\nZugriffsstatus (angeforderte Datei \xfcbertragen, nicht gefunden etc.)\nErkennungsdaten des verwendeten Browser- und Betriebssystems (sofern vom anfragenden Webbrowser \xfcbermittelt)\nWebseite, von der aus der Zugriff erfolgte (sofern vom anfragenden Webbrowser \xfcbermittelt)\nDie Verarbeitung der Daten in dieser Logdatei geschieht wie folgt:\n\nDie Logeintr\xe4ge werden kontinuierlich automatisch ausgewertet, um Angriffe auf die Webserver erkennen und entsprechend reagieren zu k\xf6nnen.\nIn Einzelf\xe4llen, d.h. bei gemeldeten St\xf6rungen, Fehlern und Sicherheitsvorf\xe4llen, erfolgt eine manuelle Analyse.\nLogeintr\xe4ge, die \xe4lter als sieben Tage sind, werden durch K\xfcrzung der IP-Adresse anonymisiert.\nDie anonymisierten Logs werden zur Erstellung von Zugriffsstatistiken verwendet. Die hierf\xfcr eingesetzte Software wird lokal vom LRZ betrieben.\nDie in den Logeintr\xe4gen enthaltenen IP-Adressen werden vom LRZ nicht mit anderen Datenbest\xe4nden zusammengef\xfchrt, so dass f\xfcr das LRZ kein R\xfcckschluss auf einzelne Personen m\xf6glich ist.\n\nAuskunft und Berichtigung\nSie haben das Recht, auf schriftlichen Antrag und unentgeltlich Auskunft \xfcber die personenbezogenen Daten zu erhalten, die \xfcber Sie gespeichert sind. Zus\xe4tzlich haben Sie das Recht auf Berichtigung unrichtiger Daten. Den beh\xf6rdlichen Datenschutzbeauftragten der Technischen Universit\xe4t M\xfcnchen erreichen Sie per E-Mail unter beauftragter(at)datenschutz.tum.de oder \xfcber www.datenschutz.tum.de.\n                                                ',null)
